dataProcessor.fnString:
return function(lineData, index) {
  if (index < 2) {
    return null;
  }

  var type = lineData[2].toLowerCase();
  var card = {
    'name': lineData[0],
    'cost': lineData[8],
    'element': '{{element.' + lineData[1].toLowerCase() + '}}',
    'type': '{{type.' + type.substr(0, 1) + '}}',
    'count': lineData[3],
    'tap': lineData[7].startsWith('T: ')
  };

  card['description'] = card['tap'] ? lineData[7].substring(3) : lineData[7]

  if (type === 'device' || type === 'minion') {
    card['life'] = lineData[4] || 0;
  }

  if (type === 'minion') {
    card['attack'] = lineData[5] || 0;
    card['armor'] = lineData[6] || 0;
  }

  if (lineData[0] === 'Poltergeist') {
    card['attack'] = '?';
  }

  return card;
};

bg.fnString:
return function(type, element) {
  return Handlebars.helpers._imgUrl(element + '_' + type + '.png');
};

stats.fnString:
return function(element, type) { 
 return Handlebars.helpers._imgUrl(element + '_' + type + '_stats.png');
}

capitalize.fnString:
return function(text) { 
 return '<span class="first-letter">' + text[0] + '</span>' 
 + text.substring(1);
}

desc.fnString:
return function(value) {
  var replaced = value
      .replace(/\(/, '<i>(')
      .replace(/\)/, ')</i>')
      .replace(/\/\//, '</p><p>');
  return '<p>' + replaced + '</p>';
}
